В Питере мы насладились прогулкой по ночной Неве с разводом мостов. 

Сортавала покорила нас своим горным парком Рускеала😍 и живописнейшими шхерами Ладожского озера🌊 но расстроила отсутствием кафе и закрытием продуктовых магазинов в 22.00(эх мы, избалованные #москвичи😀)
P.S. Так же советую к посещению в Сортавале очень атмосферное старое финское кладбище и подъем на гору Пасо, где можно встретить красивый закат🌅

Петрозаводск запомнился как город с прекраснейшей набережной Онежского озера и морским клубом-музеем «Полярный Одиссей». Этот музей интересен тем, что там проектируют и строят копии исторических парусов🛶
P.S. Обязателен к посещению ресторан ягель @yagel_ptz где можно попробовать лосятину, медвежатину, оленину итд.

